import Head from "next/head";
const Header = () => {
  return (
    <div>
      <Head>
        <title>NextJs</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
        <link
          rel="stylesheet"
          href="https://cdnjs.cloudflare.com/ajax/libs/bulma/0.3.1/css/bulma.min.css"
        />
      </Head>
    </div>
  );
};
export default Header;
